import { useEffect } from "react";

export default function TestKraken() {
    useEffect(() => {
        const ws = new WebSocket("wss://ws.kraken.com/v2");

        ws.onopen = () => {
            console.log("Connected to Kraken v2");

            ws.send(JSON.stringify({
                method: "subscribe",
                params: {
                    channel: "ticker",
                    symbol: ["BTC/USD", "POL/USD"]
                }
            }));
        };

        ws.onmessage = (event) => {
            const msg = JSON.parse(event.data);
            console.log("Msg:", msg);
        };

        ws.onclose = () => {
            console.log("Disconnected from Kraken v2");
        };

        return () => ws.close();
    }, []);

    return <div></div>;
}
